import {
  Homepage,
  DesignSystem
} from '../container/pages/Homepage';


const AppRoutes = [
  {
    id: 1,
    path: '/',
    component: Homepage,
    exact: true
  },
  {
    id: 2,
    path: '/design-system',
    component: DesignSystem,
    exact: true
  }
]


export default AppRoutes;
